import React from 'react';

interface Todo {
	text: string;
	isCompleted: boolean;
}

interface Props {
  todo: Todo;
}

export const TodoListItem:React.FC<Props> = ({ todo }) => {
  return <li>
  	<input type='checkbox' />
  	<p>{todo.text}</p>
  </li>;
};
